import React from 'react'
import styled from 'styled-components'

export default function LoginPage() {
  return (
      <Login>
        <h1>Login</h1>
        <ul >
          <li >
            <button >
              Google
            </button>
          </li>
          <li >
            <button >
              Github
            </button>
          </li>
        </ul>
      </Login>
  )
}

const Login=styled.section`
  width: 30em;
  text-align: center;
  display: flex;
  flex-direction: column;
  justify-content: center;
  background-color: White;
`
